import React from 'react';
import { useAdminAuth } from '../AdminAuthenticateContext.js';

function AdminDashboard() {
  const { adminUser } = useAdminAuth();

  return (
    <div style={{ display: 'flex', minHeight: '100vh', backgroundColor: '#333', color: 'white' }}>
      {/* Sidebar */}
      <div style={{ width: '250px', backgroundColor: 'black', padding: '20px', display: 'flex', flexDirection: 'column' }}>
        <h2 style={{ color: 'white', marginBottom: '30px' }}>Admin</h2>
        <button style={buttonStyle}>Dashboard</button>
        <button style={buttonStyle}>Users</button>
        <button style={buttonStyle}>Settings</button>
        <button style={buttonStyle}>Logout</button>
      </div>

      {/* Main Content */}
      <div style={{ flex: 1, padding: '40px' }}>
        {console.log(adminUser)}
        <h1>Admin Dashboard</h1>
        <p>Welcome to the admin dashboard!</p>
      </div>
    </div>
  );
}

const buttonStyle = {
  backgroundColor: '#444',
  color: 'white',
  border: 'none',
  padding: '12px 20px',
  margin: '10px 0',
  cursor: 'pointer',
  borderRadius: '5px',
  textAlign: 'left'
};

export default AdminDashboard;
